import org.apache.spark.SparkConf;
import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.JavaSparkContext;
import org.apache.spark.api.java.function.Function;
import org.apache.spark.api.java.function.PairFunction;
import org.apache.spark.api.java.function.VoidFunction;

import java.util.*;

public class CacheHitRate {
    public static void main(String[] args) {
        SparkConf conf = new SparkConf().setAppName("CacheHitRate");
        JavaSparkContext sc = new JavaSparkContext(conf);

        // Load onsite attributed data
        JavaRDD<String[]> onsiteData = sc.textFile("onsite_data.txt")
                .map(line -> line.split(","))
                .map(arr -> new String[]{arr[0], arr[1]});

        // Load top frequent queries
        JavaRDD<String> topFrequentQueries = sc.textFile("top_frequent_queries.txt")
                .map(line -> line.split(",")[0]);

        // Calculate cache hit rate
        JavaPairRDD<String, Integer> onsiteDataWithCount = onsiteData.mapToPair(new PairFunction<String[], String, Integer>() {
            @Override
            public Tuple2<String, Integer> call(String[] arr) throws Exception {
                return new Tuple2<>(arr[0], 1);
            }
        }).reduceByKey(Integer::sum);

        JavaPairRDD<String, Integer> onsiteDataWithHitCount = onsiteDataWithCount.leftOuterJoin(topFrequentQueries.mapToPair(new PairFunction<String, String, Integer>() {
            @Override
            public Tuple2<String, Integer> call(String query) throws Exception {
                return new Tuple2<>(query, 1);
            }
        }).reduceByKey(Integer::sum));

        JavaPairRDD<String, Double> cacheHitRate = onsiteDataWithHitCount.mapToPair(new PairFunction<Tuple2<String, Tuple2<Integer, Integer>>, String, Double>() {
            @Override
            public Tuple2<String, Double> call(Tuple2<String, Tuple2<Integer, Integer>> tuple) throws Exception {
                int total = tuple._2._1;
                int hit = tuple._2._2;
                return new Tuple2<>(tuple._1, (double) hit / total);
            }
        });

        cacheHitRate.saveAsTextFile("cache_hit_rate.txt");
    }
}
