class Group:
    def __init__(self, elements, operation):
        self.elements = elements
        self.operation = operation

    def __str__(self):
        return f"Group with {len(self.elements)} elements and operation {self.operation.__name__}"

    def is_element(self, element):
        return element in self.elements

    def is_associative(self):
        for a in self.elements:
            for b in self.elements:
                for c in self.elements:
                    if not self.operation(self.operation(a, b), c) == self.operation(a, self.operation(b, c)):
                        return False
        return True

    def is_identity(self, element):
        for a in self.elements:
            if not self.operation(element, a) == a:
                return False
        return True

    def is_inverse(self, element):
        for a in self.elements:
            if self.operation(element, a) == self.operation(a, element):
                return True
        return False

    def is_group(self):
        if not self.is_associative():
            return False
        if not self.is_identity(self.elements[0]):
            return False
        for element in self.elements:
            if not self.is_inverse(element):
                return False
        return True

