This code creates a new context `TooltipContext` and a provider `TooltipProvider` that wraps the children components. The provider has a state `tooltip` that stores the currently opened tooltip and a function `closeTooltip` that sets the state to `null` when called.

Next, create a new file `tooltip.js` and add the following code:
```js
import { useContext } from 'react';
import { TooltipContext } from './tooltipContext';

const Tooltip = ({ children, text }) => {
  const { tooltip, closeTooltip } = useContext(TooltipContext);

  const handleClick = () => {
    if (tooltip) {
      closeTooltip();
    }
    setTooltip(text);
  };

  return (
    <div
      onMouseEnter={() => {
        if (!tooltip) {
          handleClick();
        }
      }}
      onMouseLeave={closeTooltip}
    >
      {children}
      {tooltip && (
        <div className="tooltip">
          <span>{text}</span>
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```
This code creates a `Tooltip` component that uses the `useContext` hook to get the `tooltip` state and the `closeTooltip` function from the `TooltipContext`. The component has a `handleClick` function that sets the `tooltip` state to the provided `text` when the component is clicked. The component also has an `onMouseEnter` event handler that sets the `tooltip` state to the provided `text` when the mouse enters the component. The component also has an `onMouseLeave` event handler that calls the `closeTooltip` function when the mouse leaves the component.

